import HomeNavbar from "../../../components/HomeNavbar/HomeNavbar";
import "../Academicblogs/AcademicBlog.css";
import "./SingleBlog.css";
import SingleBlogComponent from "../../../components/SingleBlogComponent";
import Footer from "../../../components/Footer/Footer";
const SingleBlogPage = () => {
  return (
    <div className="academic-blog single-blogs">
      <HomeNavbar />
      <p className="empty"></p>
      <div className="container">
        <SingleBlogComponent />
      </div>
      <div className="container">
        <p className="medium-header" style={{ textAlign: "start" }}>
          Recent Posts
        </p>
      </div>
      <div className="container">
        <div className="grid">
          <div className="card">
            <div className="img-wrapper">
              <img
                src="https://images.unsplash.com/photo-1544716278-e513176f20b5?q=80&w=1374&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D"
                alt="book"
              />
            </div>
          </div>
        </div>
      </div>
      <Footer />
    </div>
  );
};

export default SingleBlogPage;
